import logo from './logo.svg';
import './App.css';

function App() {
  return (
      <div className="App">
          <p>Away</p>
        <input type="text" placeholder = "away team"/>
        <input type="number" placeholder = "away injuries (per)"/>
          <br/>
          <p>Home</p>
        <input type="text" placeholder = "home team"/>
        <input type="number" placeholder = "home injuries (per)"/>

          <button></button>
      </div>
  );
}

export default App;
